--
-- Name: v_soal_category; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_soal_category AS
 SELECT DISTINCT s.subject_id,
    s.category,
    m.materi_id,
    ms.available_status
   FROM ((public.soal s
   JOIN public.materi m ON ((s.materi_id = m.materi_id)))
   JOIN public.materi_sekolah ms ON ((ms.materi_id = m.materi_id)));


ALTER TABLE public.v_soal_category OWNER TO postgres;

