compalining, start winning. (Julian Foe, Founder Kingdom Business Community)	10	\N	https://api.indopustakaplus.com/url/pdf/Aku Tidak Buta.pdf	\N	\N	\N	2023-09-08 10:18:54.613	\N	170	1
