13	Beasiswa Sampoerna 2023-2024	2023-08-08 11:23:59	Persyaratan Beasiswa Sampoerna\r\n \r\n\r\nSama hal nya seperti beasiswa lainnya, Beasiswa Sampoerna juga memiliki persyaratan beasiswa tersendiri. Sasaran penerima beasiswa milik Sampoerna Foundation umumnya adalah masyarakat Indonesia yang masih memiliki status sebagai pelajar yang memiliki kesulitan dari segi finansial. Namun, para pelajar ini juga harus memiliki prestasi di bidang masing-masing. \r\n\r\nUntuk para pemohon beasiswa, akan lebih baik jika memiliki semangat untuk membangun bangsa dan negara dan juga memiliki jiwa pemimpin. Hal ini berguna agar pemohon beasiswa bisa lolos dalam seleksi penerimaan beasiswa dan menjadi penerima beasiswa Sampoerna Foundation. Selain hal tersebut, terdapat persyaratan Beasiswa Sampoerna lainnya yang wajib dipenuhi para pemohon beasiswa.. Berikut syarat-syarat khusus yang dikeluarkan Sampoerna Foundation sebagai syarat beasiswa:\r\nPemohon beasiwa merupakan Warga Negara Indonesia\r\nMemiliki nilai akademik rata-rata minimal 7.00 untuk jenjang SMA (dari kelas 10 hingga kelas 12)\r\nMelampirkan bukti bahwa pemohon beasiswa membutuhkan tunjangan untuk biaya sekolah yang dibuktikan dengan surat keterangan tidak mampu dan fotocopy tagihan listrik rumah.\r\nTidak sedang menerima beasiswa dari instansi/lembaga manapun\r\nMenyerahkan formulir pendaftaran\r\n\r\nAdapun untuk persyaratan tersebut harus didukukung dengan adanya dokumen yang wajib dilampirkan sebagai berikut:\r\nFormulir pendaftaran yang telah diisi dan ditandatangai\r\nDua surat referensi dalam amplor tertutup\r\nPernyataan pribadi\r\nFotokopi KTP/passport yang berlaku\r\nFotokopi KTP/Passport orang tua yang masih berlaku\r\nFotokopi Kartu Keluarga yang masih berlaku\r\nSatu pas foto berukuran 4x6 terbaru\r\nFotokopi Ijazah SMA (jika telah dikeluarkan)\r\nFotokopi Surat Tanda Tamat Belajar (STTB) (jika telah dikeluarkan)\r\nFotokopi Surat Keterangan Hasil Ujian Nasional (jika telah dikeluarkan)\r\nFotokopi masuk universitas yang terpilih\r\nFotokopi rekening listrik selama 3 bulan terakhir\r\nFotokopi bukti pendaftaran telah masuk universitas\r\nFotokopi slip gaji orang tua selama 3 bulan terkahir\r\nSurat asli keterangan tidak mampu dari Lurah atau Camat setempat\r\nSurat keterangan belum menerima beasiswa dari instansi lain dari pihak sekolah\r\n\r\nKeuntungan dan Anggaran Beasiswa Sampeorna\r\n\r\nSetiap beasiswa pastinya memiliki keuntungan tersendiri. Namun, berbeda dengan instansi lainnya, Sampoerna Foundation menawarkan dana beasiswa yang cukup besar. Banyak keuntungan yang bisa didapat melalui beasiswa ini yaitu:\r\nBiaya penuh pendidikan selama kuliah\r\nBiaya penuh pendaftaran kuliah\r\nTunjangan buku selama masa kuliah\r\nTunjangan akses internet yang bertujuan agar penerima bisa mendapatkan akses internet untuk menunjang kegiatan belajar\r\nUang saku biaya hidup selama kuliah\r\n\r\nDana tersebut merupakan dana beasiswa penuh yang anggaran akan ditanggung penuh oleh Sampoerna Foundation. Jadi, selama masa kuliah kamu akan mendapatkan dana beasiswa sampoerna. Seluruh dana 100% akan ditanggung oleh Sampoerna Foundation. Untuk mendapatkan beasiswa ini, kamu hanya harus melengkapi persyaratan yang telah disediakan oleh Sampoerna Foundation. Untuk pendaftaran beasiswa ini, Sampoerna Foundation biasanya akan membuka beasiswa ini di bulan Januari dan beasiswa akan ditutup pada pertengahan bulan Maret. \r\n\r\nProgram beasiswa dari Sampoerna Foundation ini diberikan untuk siapaun selama masih Warga Negara Indonesia tanpa membatasi asal daerah pemohon dan asal sekolah. Semua pelajar di Indonesia bisa mendaftar selama sanggup untuk melenggkapi persyaratan yang telah ada. Untuk bisa berhasil lolos seleksi beasiswa ini, pastikan bahwa segala dokumen persyaratan telah lengkap. Hal ini sangat berpengaruh terhadap proses seleksi. Pendaftaran Beasiswa Sampoerna dilaksanakan melalui http://www.sampoernafoundation.org dan kerjasama kampus hampir diseluruh Indonesia. Dengan harapan dapat membangun pendidikan untuk negeri.	https://www.primagamasiap.com/tryoutsnbt.php
