14	SAMBADHA DONOR DARAH	2023-08-20 11:23:59	Donor darah merupakan salah satu kegiatan sosial yang bertujuan untuk membantu antar sesama yang sedang membutuhkan transfusi darah. Namun, bila ditelisik dari segi Kesehatan, ternyata mendonorkan darah tidak hanya bermanfaat bagi mereka yang membutuhkannya. Tapi, kita sebagai pendonor, turut mendapatkan manfaat besar bagi kesehatan diri sendiri ketika rutin mendonorkan darah.\r\n\r\nPertama, kegiatan donor darah ini sangat berguna untuk kesehatan kita sendiri dan memberikan dampak positif bagi tubuh kita. Kedua, kegiatan ini merupakan kegiatan sosial yang sangat mulia karena dari mendonorkan darah kita, kita sudah bisa membantu banyak orang dan dapat menyelamatkan nyawa orang lain. Jadi dengan mendonorkan darah kita sudah membuat banyak harapan untuk orang lain.\r\n\r\nBerangkat dari panggilan jiwa untuk membantu sesama, seluruh civitas akademika SMA Negeri 1 Pandeglang bekerja sama dengan PMI Pandeglang , pada hari Rabu (01/02/2023) kemarin,menyelenggarakan Kegiatan Donor Darah dengan tajuk Sambadha Donor Darah yang diikuti oleh Para Tenaga Pendidik dan Tenaga Kependidikan, serta seluruh siswa dan siswi kelas XI dan XII.\r\n\r\nKegiatan yang sangat mulia ini perlu kita beri apresiasi, Karena dengan setetes darah yang kita sumbangkan, akan menyelamatkan keselamatan jiwa sesama,sebagai manifestasi perwujudan  hadist nabi yang berbunyi  Sebaik-baiknya manusia harus bermanfaat bagi manusia.	https://www.primagamasiap.com/tryoutsnbt.php
