6	Seminar Nasional Pendidikan 2023	2023-08-24 13:45:18	<p>\tTantangan Pendidikan Abad 21 dalam Meningkatkan Kualitas Pendidik dan Generasi Muda di Era Digital Indonesia adalah negara yang mengedepankan pendidikan, karena pendidikan adalah kunci utama Indonesia mampu bersaing dalam kancah Internasional. </p><p><br></p><p>\tDalam dunia pendidikan, salah satu faktor penting yang perlu diperhatikan adalah kualitas guru di Indonesia, karena guru merupakan kunci penggerak utama dalam dunia pendidikan, pendidikan tanpa seorang guru tidaklah ada harganya. Namun realitanya di Indonesia kualitas guru masih sangat rendah, misalnya kurangnya pengetahuan tentang teknologi khususnya pada guru-guru yang senior, kurangnya kesadaran guru zaman sekarang mengenai tugas dan kewajiban guru, selain itu juga dikarenakan kreativitas yang terbatas, hal ini meyebabkan pendidikan di Indonesia tertinggal. </p><p><br></p><p>\tPeningkatan mutu pendidikan di Indonesia harus digencarkan melalui kegiatan-kegiatan yang dapat membangun motivasi dan kesadaran guru di Indonesia untuk mengatasi masalah hambatan yang ada di Indonesia. Oleh karena itu, sehubungan hal tersebut, HIMA PGSD FIP UNNES 2019 mengadakan kegiatan Seminar Nasional Pendidikan dengan mengusung tema Tantangan Pendidikan Abad 21 Dalam Meningkatkan Kualitas Pendidik dan Generasi Muda di Era Digital. </p><p><br></p><p>\tPembelajaran Abad 21 memiliki prinsip pokok bahwa pembelajaran harus berpusat pada siswa yang bersifat kolaboratif, kontekstual dan berintegrasi dengan masyarakat. Dalam melaksanakan pembelajaran, Guru memiliki peran penting dalam mewujudkan masa depan anak bangsa yang lebih baik. Kaitanya dengan pendidikan di Indonesia utamanya yaitu Perguruan Tinggi merupakan lembaga formal yang diharapkan dapat melahirkan tenaga pendidik yang mumpuni dalam mendidik peserta didik di era digital ini. </p><p><br></p><p>\tSelain itu, tantangan berikutnya adalah rekonstruksi kurikulum pendidikan tinggi yang responsif terhadap era digital juga diperlukan, seperti desain ulang kurikulum dengan pendekatan human digital dan keahlian berbasis digital. Dalam hal ini sehingga diharapkan dapat meningkatkan motivasi dan kreativitas guru meningkatkan pendidikan di Indonesia. </p><p><br></p><p>\tDalam Seminar Nasional Pendidikan kali ini, kita mengangkat tema  Tantangan Pendidikan Abad 21 dalam Meningkatkan Kualitas Pendidik dan Generasi Muda di Era Digital yang akan membahas tentang Pendidikan Karakter, Inovasi dan media pembelajaran, Teknologi Informasi dan Komunikasi dan Pendidikan Literasi. </p><p><br></p><p>\tSeminar nasional pendidikan 2019 mengundang pembicara yang berkompeten dibidangnya, antara lain Prof. Dr. Totok Sumaryanto F, M. Pd (Pakar Penelitian dan Evaluasi Pendidikan yang akan membahas mengenai Tantangan Pendidikan Abad 21), Bapak Falidan Ahmad, M. Pd (Widyaiswara PPPPTK PKn IPS Kemdikbud membahas tentang Kualitas Pendidik dan Generasi Muda), dan Ibu Yunina Resmi Prananta, M. Pd (Master of Teacher Ruang Guru Excellent Teacher, Writer, Trainer Entrepreneur Melu Nyong Tour yang akan membahas tentang Tantangan Pendidik dan Generasi Muda di Era Digital).</p>	https://www.primagamasiap.com/tryoutsnbt.php
24	Pendaftaran SBMPTN 2023	2023-08-24 16:19:58	<p><span style="color: rgb(42, 42, 42);">Seleksi Bersama Masuk Perguruan Tinggi Negeri (SBMPTN) kini telah diubah menjadi Seleksi Nasional Berdasarkan Tes (SNBT). SBMPTN atau SNBT 2023 adalah seleksi nasional berdasarkan tes yang kini berfokus pada kemampuan penalaran dan pemecahan masalah bagi calon mahasiswa. </span></p><p><br></p><p><span style="color: rgb(42, 42, 42);">Dalam pelaksanaan ujian SNBT, tidak ada lagi tes mata pelajaran, melainkan hanya tes skolastik. Tes tersebut mengukur empat hal yaitu potensi kognitif, penalaran matematika, literasi dalam bahasa Indonesia, dan literasi dalam bahasa Inggris. </span></p><p><br></p><p><span style="color: rgb(42, 42, 42);">Tahun ini ujian SBMPTN atau SNBT 2023 sepenuhnya dipersiapkan oleh Tim Seleksi Nasional Penerimaan Mahasiswa Baru (SNPMB). Selain itu, jika di tahun sebelumnya seleksi mahasiswa baru PTN dikelola oleh Lembaga Tes Masuk Perguruan Tinggi (LTMPT).</span></p><p><br></p><p><span style="color: rgb(42, 42, 42);">Syarat pendaftaran SBMPTN 2023 Dilansir dari laman resmi SNPMB, berikut adalah syarat pendaftaran SBMPTN atau UTBK SNBT 2023:</span></p><p><br></p><p><span style="color: rgb(42, 42, 42);">Memiliki Akun SNPMB Warga Negara Indonesia (WNI) yang memiliki Nomor Induk Kependudukan (NIK) </span></p><p><span style="color: rgb(42, 42, 42);">Sehat jasmani dan rohani </span></p><p><span style="color: rgb(42, 42, 42);">Siswa SMA/MA/SMK/sederajat calon lulusan tahun 2023 </span></p><p><span style="color: rgb(42, 42, 42);">harus memiliki Surat Keterangan Siswa SMA/MA/SMK Kelas 12 atau peserta didik Paket C tahun 2023 dengan umur maksimal 25 tahun (per 1 Juli 2023) </span></p><p><span style="color: rgb(42, 42, 42);">Siswa lulusan SMA/MA/SMK/sederajat tahun 2021 dan 2022 atau lulusan Paket C tahun 2021 dan 2022 yang memiliki ijazah dengan umur maksimal 25 tahun (per 1 Juli 2023) </span></p><p><span style="color: rgb(42, 42, 42);">Lulusan SMA sederajat dari luar negeri, dengan memiliki ijazah yang sudah disetarakan Peserta yang tidak lulus jalur SNBP 2023 atau SNMPTN pada tahun 2021 dan 2022 </span></p><p><span style="color: rgb(42, 42, 42);">Portofolio bagi peserta yang memilih program studi bidang seni dan olahraga Bagi peserta tuna netra wajib mengunggah Surat Pernyataan Tuna Netra </span></p><p><br></p><p><span style="color: rgb(42, 42, 42);">Sebagai catatan, surat Keterangan Siswa Kelas 12 disertai dengan foto berwarna terbaru, stempel/cap sekolah, dan tanda tangan Kepala Sekolah. Hasil UTBK 2023 hanya berlaku untuk mengikuti SNBT dan penerimaan PTN 2023.</span></p><p><br></p><p><span style="color: rgb(42, 42, 42);">Artikel ini telah tayang di&nbsp;</span><a href="https://www.kompas.com/" target="_blank" style="color: inherit;">Kompas.com</a><span style="color: rgb(42, 42, 42);">&nbsp;dengan judul "Pendaftaran SBMPTN 2023, Berikut Syarat, Biaya, dan Prosedurnya", Klik untuk baca:&nbsp;</span><a href="https://www.kompas.com/tren/read/2023/03/27/141815265/pendaftaran-sbmptn-2023-berikut-syarat-biaya-dan-prosedurnya" target="_blank" style="color: inherit;">https://www.kompas.com/tren/read/2023/03/27/141815265/pendaftaran-sbmptn-2023-berikut-syarat-biaya-dan-prosedurnya</a><span style="color: rgb(42, 42, 42);">.</span></p><p><span style="color: rgb(42, 42, 42);">Penulis : Muhammad Zaenuddin</span></p><p><span style="color: rgb(42, 42, 42);">Editor : Muhammad Zaenuddin</span></p><p><br></p><p><span style="color: rgb(42, 42, 42);">Kompascom+ baca berita tanpa iklan:&nbsp;</span><a href="https://kmp.im/plus6" target="_blank" style="color: inherit;">https://kmp.im/plus6</a></p><p><span style="color: rgb(42, 42, 42);">Download aplikasi:&nbsp;</span><a href="https://kmp.im/app6" target="_blank" style="color: inherit;">https://kmp.im/app6</a></p>	\N
25	Beasiswa Unggulan Masyarakat Berprestasi untuk S1, S2, S3	2023-08-24 17:18:10	<p><span style="color: rgb(0, 0, 0);">Beasiswa Unggulan Kementerian Pendidikan, Kebudayaan, Riset, dan Teknologi (Kemendikbudristek) memiliki beragam variasi beasiswa. Selain&nbsp;</span><a href="http://www.beasiswapascasarjana.com/2016/07/beasiswa-unggulan-pegawai-kemdikbud.html" target="_blank" style="color: rgb(53, 119, 152);">Beasiswa Unggulan Pegawai Kemdikbudristek</a><span style="color: rgb(0, 0, 0);">. Yang satu ini tak kalah menariknya. Beasiswa Unggulan Masyarakat Berprestasi. Namanya lebih spesifik untuk membedakan Beasiswa Unggulan yang satu dengan lainnya.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Beasiswa Unggulan Masyarakat Berprestasi ditujukan bagi masyarakat berprestasi di segala bidang, terutama calon mahasiswa yang baru diterima di perguruan tinggi maupun mahasiswa aktif maksimal semester 3. Beasiswa Unggulan Masyarakat Berprestasi ditujukan bagi pelamar umum.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Beasiswa yang ditawarkan ditujukan untuk program gelar S1, S2, dan S3. Bila Anda saat ini telah diterima di perguruan tinggi dalam negeri dengan akreditasi perguruan tinggi minimal B, Beasiswa Unggulan Masyarakat Berprestasi ini sayang untuk dilewatkan. Begitupun dengan Anda yang sudah berstatus mahasiswa aktif dan maksimal semester 3, Anda juga bisa mendaftar. Jadi, pelamar bisa berasal dari mahasiswa baru atau mahasiswa yang sedang menjalani perkuliahan (</span><em style="color: rgb(0, 0, 0);">on going</em><span style="color: rgb(0, 0, 0);">).</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Beasiswa yang diberikan untuk program gelar S1, S2, dan S3 meliputi biaya pendidikan, biaya hidup, dan biaya buku.</span></p>	\N
