16	Ciri Khas Laki-laki dan Perempuan	2023-09-18	17:30	18:20	17	<p>Kita diciptakan Allah dalam dua kodrat yang berbeda, sebagai seorang laki-laki dan perempuan. Dua kodrat ini mempunyai perbedaan satu sama lain. Perbedaan kodrat ini yang terkadang membawa pertentangan, tetapi juga merupakan keajaiban yang luar biasa. Dalam kisah penciptaan betapa indahnya Allah menciptakan kita semua, laki-laki maupun perempuan. Kita adalah pribadi yang telah diciptakan Allah dengan baik adanya untuk saling mengisi dunia ini. (Kej 1:26-31). Perbedaan-perbedaan yang ada tentunya didasari oleh apa yang kodrati, yaitu perbedaan fisik yang memang sudah tergariskan sejak lahir secara genetic. Kita menyadari, bahwa perbedaan laki-laki dan perempuan secara kodrati mempunyai kekhasan yang tidak terbantahkan. Perbedaan itu jelan merupakan perbedaan secara biologis yang dipengaruhi oleh hormone dominan yang berbeda, pada rambut, mata, pipi, mulut, leher, dada, pinggul, dan betis. Yang menunjukkan halus pada perempuan dan kekar pada laki-laki, dan perbedaan yang menjadikan sungguh berbeda laki-laki sungguh laki-laki dan perempuan sungguh perempuan adalah organ kelamin. Dan secara khusus perbedaan biologis antara laki-laki dan perempuan dapat dipelajari dalam pelajaran biologi.</p><p>Perbedaan fisik-biologis inilah yang menjadi penanda yang khas, antara laki-laki dan perempuan. Tentu perbedaan fisik juga sering kali membawa perbedaan psikologis atau sikap dan perasaan dalam bertindak. Sehingga perbedaan laku-laki dan perempuan bukan sekedar perbedaan jasmaniah saja tetapi juga menyangkut hal-hal kejiwaan. Kita dapat melihat perbedaan laki-laki dan perempuan berkaitan dengan cara berfikir, cara merasa, cara bertindak, serta cara memandang hidup dan kehidupan. Tentu pada beberapa hal merupakan kecenderungan yang sering kali tidak dapat menjadi sebuah ketetapan yang pasti dan akurat, hal ini hanya merupakan gejala umum.</p>	\N	414	\N
