645	\N	34	3	BI3-PH-2-01	Bacalah teks berikut dengan saksama kemudian jawablah pertanyaan di bawahnya dengan benar!\n\nCiri-ciri Makhluk Hidup\nSalah satu ciri makhluk hidup adalah berkembang biak. Berkembang biak bertujuan untuk melestarikan atau mempertahankan spesies makhluk hidup di Bumi. Berkembang biak dilakukan supaya makhluk hidup bisa menghasilkan keturunan.\nMakhluk hidup berkembang biak dengan cara yang berbeda-beda. Seperti kita tahu, manusia berkembang biak dengan cara melahirkan seorang bayi. Hewan berkembang biak dengan bertelur (ovipar), melahirkan (vivipar), dan bertelur juga melahirkan (ovovivipar). Tumbuhan berkembang biak dengan biji, tunas, spora, setek, dan okulasi.\nSetiap makhluk hidup mengalami proses pertumbuhan dan perkembangan. Pertumbuhan dan perkembangan ini sebagai dua proses yang berjalan beriringan. Pertumbuhan mengacu kepada perubahan fisik berupa pertambahan tinggi dan besar badan. Kita bisa mengukur tinggi dan berat badan kita menggunakan meteran dan timbangan badan. Perkembangan adalah proses menuju tercapainya kedewasaan, contohnya semakin pandai berbicara, semakin lancar berjalan, semakin pandai membaca, dan lain-lain.  \nPertumbuhan dan perkembangan tumbuhan dimulai sejak biji ditanam kemudian menjadi kecambah. Kecambah kemudian berkembang menjadi tumbuhan kecil. Setelah tumbuh hingga mencapai ukuran dan usia tertentu, tumbuhan akan berkembang membentuk bunga dan buah atau biji sebagai alat perkembangbiakannya.\n\nTuliskan cara hewan berkembang biak!	2	\N	\N	\N	\N	Cara hewan berkembang biak yaitu dengan bertelur (ovipar), melahirkan (vivipar), dan bertelur juga melahirkan (ovovivipar).	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	131
